import React from 'react';

import classes from './Cars.module.css';

const Cars = (props) => {

    const getCars = (props.userCars).map((cars, pos) => {
        return <li key={pos}>sda</li>;
    });

    console.log(getCars);
    

  return (
    <div className="cars-list">
      <ul>
        {getCars}
      </ul>
    </div>
  );
};

export default Cars;
